  \"Habitat and predator management for nesting piping plovers on Lostwood National
  Wildlife Refuge, North Dakota\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-10-08T15:56:16.685350\",\n\t\"name\": \"habitat-and-predator-management-for-nesting-piping-plovers-on-lostwood-national-wildlife-r\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Population levels, nesting effort, and
  pair success of piping plovers (Charadrius melodus) were monitored in northwestern
  North Dakota in years before and during attempts to improve breeding habitat. An
  increase in the plover breeding population appeared unrelated to management efforts,
  but pair success on sites prescribe-burned(n = 15 pairs) and on sites burned and
  protected by predator exclosure fences (n= 15 pairs) was greater than expected based
  on unmanaged sites (n = 24 pairs; both P < 0.001 ). Attempts to create new breeding
  habitat by adding gravel to unused beach areas had limited success (one of five
  sites used one year), mainly due to vegetation encroachment within a year. Nesting
  sites on one area were avoided by plovers during three consecutive years of grazing
  by cattle during the nesting season, but pair numbers exceeded pregrazing levels
  in years following grazing.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
